import React from "react";
//URLを定義する場所を指定するためのインポート
import { BrowserRouter, Routes, Route, Link, useParams } from "react-router-dom";
import './App.css';

const App = () => {
  return (
      //BrouserRouterの中にURLを定義します。
      <BrowserRouter>
        <div class="container text-center mt-5">
          <Routes>
            <Route exact path="/" element={<Home />} />
            <Route exact path="/login" element={<Login />} />
            <Route path="/dashboard/:id" element={<Dashboard />} />
            <Route path="/*" element={<NotFound />} />
          </Routes>
        </div>
      </BrowserRouter>
  );
}
//Appをエクスポートします。
export default App;

//ユーザーが最初にアクセスする画面です。
const Home = () => {
  return (
    <div id="home" class="big-bg">
    <div class="body home-content d-flex align-items-end">
      <h1 class="page-title">Takemura Lab</h1>
      <p>　</p>
      <p><Link to="/login" class="button" role="button">ログイン</Link></p>
    </div>
    </div>
  );
};

//ユーザーログインのフォームです。
const Login = () => {
  return (
    <div></div>
  );
};

//ユーザーのダッシュボードです。
const Dashboard = () => {
  const params = useParams();
  return (
    <div><p>{params.id}</p></div>
  );

};

const NotFound = () => {

}
